function createHTMLConcat (concat, regex) { // 0543
    function labelsHTML (labelsArray) {
        return labelsArray.map(label => `
            <span class="px-2 inline-flex text-xs leading-5 font-semibold rounded-full ${label}-label">
                ${label}
            </span>
        `).join('');
    }

    concat = {...concat};

    const textProps = ['firstName', 'lastName', 'mail', 'phone', 'cellphone'];
    for (const prop of textProps) {
        concat[`${prop}Splited`] = concat[prop];
    }

    if (regex) {
        for (const prop of textProps) {
            const matches = concat[prop].match(new RegExp(regex, 'ig'));
            if (!matches) continue;
            for (const match of matches) {
                let regEx = new RegExp(`(^|\\w|</span>)(${match})`);
                const extracted = concat[`${prop}Splited`].match(regEx);
                concat[`${prop}Splited`] = concat[`${prop}Splited`].replace(regEx, `${extracted[1]}<span class="marked">${extracted[2]}</span>`)
                
            }
        }
    }

    const {firstName, lastName, mail, phone, cellphone, profile, labels, firstNameSplited, lastNameSplited, cellphoneSplited, phoneSplited} = concat;


    return `
    <div class="concat" data-concat-mail="${mail}">
        <div class="profile">
            <img class="h-10 w-10 rounded-full" src="${profile}" alt="${firstName +  ' ' + lastName} profile" />
        </div>
        <div class="name">
            <p class="fullname">${firstNameSplited +  ' ' + lastNameSplited}</p>
            <p class="mail">${name}m</p>
        </div>
        <div class="numbers">
            <p class="cellphone">${cellphoneSplited}</p>
            <p class="phone">${phoneSplited}</p>
        </div>
        <div class="labels">
            ${labelsHTML(labels)}
        </div>
        <div class="buttons text-sm font-medium">
            <p class="text-indigo-600 hover:text-indigo-900" onclick="concatEditor(event)">Edit</p>
            <p class="text-indigo-600 hover:text-indigo-900" onclick="deleteConcatModal(event)">Delete</p>
        </div>
    </div>
    `
}

function noConcatFound () {
    return `
        <div class="no-concat-found">
            NO CONCAT FOUND
        </div>
    `
}

const labelInputs = document.querySelectorAll('#app .label input[type="checkbox"]');
const searchInput = document.querySelector('#app .search-bar input');
const sortKeyInput = document.querySelector('#app .sort-key input');

labelInputs.forEach(labelInput => labelInput.addEventListener('input', searchConcats));
searchInput.addEventListener('input', searchConcats);
sortKeyInput.addEventListener('input', searchConcats);

const concatsContainer = document.querySelector('#app .concats-container');

function searchConcats () {

    const labelsString = [...labelInputs].map(label => {
        if (label.checked) {
            return `${label.id.replace('-label', '').replace(/^\w/, letter => letter.toUpperCase()).replace(/-\w/g, m => m[1].toUpperCase())}`;
        }
    }).filter(Boolean).join('|');

    const searchText = searchInput.value;
    const sortKey = sortKeyInput.value.replace(' ', '');

    const xhr = new FXMLHttpRequest();
    xhr.onload = function (concatsArray) {
        if (concatsArray.length === 0) {
            concatsContainer.innerHTML = noConcatFound();
            return;
        }

        let HTMLString = '';
        for (const concat of concatsArray) {
            HTMLString += createHTMLConcat(concat, searchText);
        }
        concatsContainer.innerHTML = HTMLString;
    }
    xhr.onerror = function () {
        concatsContainer.innerHTML = noConcatFound();
    }

    xhr.open('GET', `${App.name}/users/mail=${curUser.mail}/concats/search?labels=${labelsString}|&sortKey=${sortKey}&text=~firstName|lastName|phone|cellphone|mail:${searchText}~`)
    xhr.send();
}

