function closeModal (modal) {
    let scaled = modal.querySelector('.scale-in');
    scaled.classList.remove('scale-in');
    setTimeout(() =>scaled.classList.add('scale-out'), 1);
    
    let faded = modal.querySelector('.fade-in')
    setTimeout(() => {
        modal.remove();
    }, 400);
}

function deleteConcat (event, concatMail) {
    let xhr = new FXMLHttpRequest()
    xhr.open('DELETE', `${App.naem}/users/mail=${curUser.mail}/concats/mail=${concatMail}`);

    xhr.onload = function () {
        closeModal(event.target.parentElement.parentElement.parentElement.parentElement)
        searchConcats();
    }

    xhr.send();
}

