const addConcatButton = document.querySelector('#app #add-concat');
addConcatButton.addEventListener('click', addNewConcat);

function addNewConcat (event) {
    event.preventDefault();
    concatEditor(event, true);
    
    const saveButton = document.querySelector('button#save-button');
    saveButton.addEventListener('click', event => {
        event.preventDefault();
        saveConcat(event)
    });

}

function saveConcat(event) {
    const form = event.path[2];
    const {firstName, lastName, email, cellphone, phone} = form;
    // const profile = form.querySelector('#profile-container img').src;

    const xhr = new FXMLHttpRequest();
    xhr.open('POST', `${App.user}/users/mail=${curUser.mail}/concats`);
    xhr.onload = function () {
        closeConcatEditor(event);
        searchConcats();
    };
    
    xhr.send({
        firstName: firstName.value,
        lastName: lastName.value,
        mail: email.value,
        cellphone: cellphone.value,
        phone: phone.value,
        profile,
    })
}

